/* eslint-disable react/no-multi-comp */
/* eslint-disable react/display-name */
import React, { lazy } from "react";
import { Redirect } from "react-router-dom";
import MainRouteRenderComponent from "../Layout/Authenticated/index";

// import AuthLayout from "../layouts/Auth";
// import ErrorLayout from './layouts/Error';
import GuestLayout from "../Layout/Guest";
 import Brancheslite from "../View/Branches/index";
 import Fabrics from "../View/Fabrics/index";
 import Brands from "../View/Brands/index";
 import FabricType from "../View/FabricType/index";


 import Styles from "../View/Styles/index";
 import Variable from "../View/Variables/index";
 import Earnings from "../View/Earnings/Earnings";

 
// import UserProfileLayout from "../Layout/UserProfile";

// const a=0
const Branches=lazy(() => import("../View/Branches/index"));
console.log(Branches,"Branches")
console.log(Branches.$$typeof,"Branches")
console.log(Brancheslite.Branches,"Branches")

const routes = [

  {
    route: "*",
    component: GuestLayout,
 
    routes: [
      {
        path: "/",
        exact: true,
        component: lazy(() => import("../View/LoginWithPasswordScreen")),
        isPrivate: false,
        // isAuth:true,
      },
      {
        path: "/login-otp",
        exact: true,
        component: lazy(() => import("../View/LoginWithOtpScreen")),
        isPrivate: false,
         isAuth:true,
      },
      {
        path: "/signup",
        exact: true,
        component: lazy(() => import("../View/Signup")),
        isPrivate: false,
        isAuth:true,
      },      
      {
        path: "/not-found-401",
        exact: true,
        component: lazy(() => import("../Layout/NotFound/NotFound")),
        isPrivate: false,
      },
    
      
      {
        route: "/dashboard",
        exact: true,
        component: MainRouteRenderComponent,
        routes: [
          {
            path: "/dashboard",
            exact: true,
            component: lazy(() => import("../View/Dashboard")),
            isPrivate: true,
          },
          {
            path: "/manage-avalibility",
            exact: true,
            component: lazy(() => import("../View/ManageAvailability")),
            isPrivate: true,
          },
          {
            path: "/branches",
            exact: true,
            component: Brancheslite.Branches,
            isPrivate: true,
          },
          {
            path: "/branches-add",
            exact: true,
            component: Brancheslite.AddEditBranches,
            isPrivate: true,
          },
          {
            path: "/branches/:id",
            exact: true,
            component: Brancheslite.AddEditBranches,
            isPrivate: true,
          },
          {
            path: "/fabrics",
            exact: true,
            component: Fabrics.Fabrics,
            isPrivate: true,
          },
          {
            path: "/fabrics-add",
            exact: true,
            component: Fabrics.AddEditFabrics,
            isPrivate: true,
          },
          {
            path: "/fabrics/:id",
            exact: true,
            component: Fabrics.AddEditFabrics,
            isPrivate: true,
          },
          {
            path: "/brands",
            exact: true,
            component: Brands.Brands,
            isPrivate: true,
          },
          {
            path: "/brands-add",
            exact: true,
            component: Brands.AddEditBrands,
            isPrivate: true,
          },
          {
            path: "/brands/:id",
            exact: true,
            component: Brands.AddEditBrands,
            isPrivate: true,
          },
          {
            path: "/fabric-type",
            exact: true,
            component: FabricType.FabricsType,
            isPrivate: true,
          },
          {
            path: "/fabric-type-add",
            exact: true,
            component: FabricType.AddEditFabricType,
            isPrivate: true,
          },
          {
            path: "/fabric-type/:id",
            exact: true,
            component: FabricType.AddEditFabricType,
            isPrivate: true,
          },
          {
            path: "/style",
            exact: true,
            component: Styles.Styles,
            isPrivate: true,
          },
          {
            path: "/styleAdd",
            exact: true,
            component: Styles.AddStyles,
            isPrivate: true,
          },
          {
            path: "/styles/:id",
            exact: true,
            component: Styles.AddStyles,
            isPrivate: true,
          },
          {
            path: "/variable",
            exact: true,
            component: Variable.Variables,
            isPrivate: true,
          },
          {
            path: "/variable-add",
            exact: true,
            component: Variable.AddEditVariables,
            isPrivate: true,
          },
          {
            path: "/variable/:id",
            exact: true,
            component: Variable.AddEditVariables,
            isPrivate: true,
          },
          {
            path: "/earnings",
            exact: true,
            component: Earnings,
            isPrivate: true,
          },
     
          {
            route: "/innerLayout",
            exact: true,
            component: lazy(() => import("../Layout/Authenticated/InnerLayout/InnerLayout")),
            isPrivate: true,
            routes: [
              
              {
                path: "/payouts",
                exact: true,
                component: lazy(() => import("../View/MyPayouts")),
                isPrivate: true,
              },
              {
                path: "/my-orders",
                exact: true,
                component: lazy(() => import("../View/MyOrders")),
                isPrivate: true,
              },
           
              {
                path: "/order-details/:order_id",
                exact: true,
                component: lazy(() => import("../View/OrderDetails")),
                isPrivate: true,
              },
              {
                path: "/order-estimation",
                exact: true,
                component: lazy(() => import("../View/OrderDetails/OrderEstimation")),
                isPrivate: true,
              },
              {
                path: "/profile",
                exact: true,
                component: lazy(() => import("../View/Profile")),
                isPrivate: true
              }, 
              {
                path: "/reviews",
                exact: true,
                component: lazy(() => import("../View/Reviews")),
                isPrivate: true,
              },
              {
                path: "/portfolio",
                exact: true,
                component: lazy(() => import("../View/Portfolio")),
                isPrivate: true,
              },
            
              {
                route: "/coupons",
                exact: true,
                component: lazy(() => import("../View/Coupon")),
                isPrivate: true,
                routes: [
                  {
                    path: "/couponview",
                    exact: true,
                    component: lazy(() => import("../View/Coupon/CouponsView")),
                    isPrivate: true,
                  },
                  {
                    path: "/couponAdd",
                    exact: true,
                    component: lazy(() => import("../View/Coupon/CouponAdd")),
                    isPrivate: true,
                  },
                 
             
              ]
              },
         
          ]
          },
     
        
         
          {
            component: () => <Redirect to="/not-found-401" />,
          },
        ],
      },
    
    ],
    
  },
  {
    component: () => <Redirect to="/" />,
  },
  

];

export default routes;
